import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ManageUsers() {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        // Fetch user data from your backend API when the component is mounted
        axios.get('http://localhost:8080/api/users') // Adjust the URL as needed
            .then(response => {
                setUsers(response.data);
            })
            .catch(error => {
                console.error("There was an error fetching the users data!", error);
            });
    }, []);

    return (
        <div className="manage-users">
            <h2>Manage User Access</h2>
            <table>
                <thead>
                    <tr>
                        <th>Username</th>
                        <th>Email</th>
                        <th>Phone Number</th>
                        <th>Role</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map(user => (
                        <tr key={user.id}>
                            <td>{user.username}</td>
                            <td>{user.email}</td>
                            <td>{user.phoneNumber}</td>
                            <td>{user.role}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default ManageUsers;
